import { useState } from 'react';
import NavInshorts from './components/NavInshorts';
import './App.css';

function App() {
  const [category, setCategory] = useState("general")
  return (
    <div>
      <NavInshorts setCategory={setCategory}/>
    </div>
  );
}

export default App;
